                '<div class="param flex flex-row items-center justify-start"><mat-icon>thermostat</mat-icon><span style="padding-left: 8px; padding-right: 8px;">' + Number(temperature).toFixed(1) + ' °C</span></div>' +
              '</div>' +
              '<div class="param-cell flex flex-1 flex-col gap-2">' +
                '<div class="param-title">Outdoor temp.: </div>' +
                '<div class="param flex flex-row items-center justify-start"><mat-icon>thermostat</mat-icon><span style="padding-left: 8px; padding-right: 8px;">' + Number(outdoorTemperature).toFixed(1) + ' °C</span></div>' +
              '</div>' +
              '<div class="param-cell flex flex-1 flex-col gap-2">' +
                '<div class="param-title">Crop level: </div>' +
                '<div class="param">'+ getCropLevelHtml(cropLevel) +'</div>' +
              '</div>' +
          '</div>' +
       '<div>';

function getAerationHtml(aeration) {
    var color = aeration === 'true' ? '#186CEF' : '#1F8B4D';
    var aerationSvg = '<svg width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg">' +
