    return '<div class="flex flex-row items-center justify-start">'+
           '<img class="mat-icon" src="'+ aerationSvgUrl +'">' +
           '<span style="padding-left: 8px;">'+ aerationLabel +'</span>' +
       '</div>';

}

function getCropLevelHtml(cropLevel) {
    var cropLevelNumber = Number(cropLevel);
    var cropLevelSvg = getCropLevelSvg(cropLevelNumber);
    var encodedCropLevelSvg = encodeURIComponent(cropLevelSvg);
