                       '<path d="M4 14H12V16H4V14Z" fill="#1F8B4D"/>' +
                       '<path d="M4 11H12V13H4V11Z" fill="#1F8B4D"/>';
    } else {
        cropLevelSvg = '<path d="M15 10.3078L14 9.5V7.43395L19 10.7217V12.7913L17 11.5495V19H15V10.3078Z" fill="#1F8B4D"/>' +
